DROP TABLE IF EXISTS `descarga`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `descarga` (
  `id` int NOT NULL AUTO_INCREMENT,
  `repartidor_id` int DEFAULT NULL,
  `carga_id` int DEFAULT NULL,
  `productos_devueltos` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `productos_vendidos` int NOT NULL,
  `envases_recuperados` int DEFAULT '0',
  `deficit_envases` int DEFAULT '0',
  `monto_total` decimal(10,2) DEFAULT '0.00',
  `observaciones` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `fecha_descarga` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `estado_cuenta` enum('pendiente','finalizado') COLLATE utf8mb4_general_ci DEFAULT 'pendiente',
  `ganancia_repartidor` decimal(10,2) DEFAULT NULL,
  `ganancia_empresa` decimal(10,2) DEFAULT NULL,
  `porcentaje_repartidor` int DEFAULT NULL,
  `porcentaje_empresa` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `carga_id` (`carga_id`),
  KEY `descarga_repartidor_fk` (`repartidor_id`),
  CONSTRAINT `descarga_ibfk_2` FOREIGN KEY (`carga_id`) REFERENCES `cargas` (`id`),
  CONSTRAINT `descarga_repartidor_fk` FOREIGN KEY (`repartidor_id`) REFERENCES `repartidores` (`id`),
  CONSTRAINT `descarga_chk_1` CHECK (json_valid(`productos_devueltos`))
) ENGINE=InnoDB AUTO_INCREMENT=199 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
